import React from 'react';
import './style.css';
import 'bootstrap/dist/css/bootstrap.min.css';


function Header() {
  return (
    <div className="App">
      <section class="bg-danger">
       <div class="container">
          <div class="row">
             <div class="header">
                <ul class="list mt-3 font-">
                   <li><a>Home</a></li>
                   <li><a>Product</a></li>  
                   <li><a>About</a></li>  
                   <li>Contact</li>    
                </ul>  
             </div> 
          </div>
        </div>
      </section> 
    </div>
  );
}

export default Header;
